import { useNavigate } from 'react-router-dom';
import './Login.css';

function Login() {
  const navigate = useNavigate();

  return (
    <div>
      <label>
        Username:
        <input type="text" placeholder="Username" />
      </label>
      <label>
        Password:
        <input type="text" placeholder="Username" />
      </label>
    </div>
  );
}

export default Login;
